import React from 'react';
import {
    GalleryContainer,
    Card,
    Image,
    Title
} from './styles'

interface imageProps {
    src: string;
    alt: string;
    title: string;
}

interface galleryProps {
    images: Array<imageProps>;
}

export const Gallery = ({ images } : galleryProps ) => {
    return (
      <GalleryContainer>
        {images.map((image, index) => (
          <Card key={index}>
            <Image src={`/img/images/${image.src}`} alt={`Gallery Image ${index + 1}`} />
            <Title>{image.title}</Title>
          </Card>
        ))}
      </GalleryContainer>
    );
};
